-------------------------------------------------------------------------
-- CÀI ĐẶT CÁC BẢNG
-------------------------------------------------------------------------

-- Table: ChungChi
CREATE TABLE [dbo].[ChungChi]
(
	[MaChungChi]	[nvarchar](50) NOT NULL,
	[TenChungChi]	[nvarchar](50) NOT NULL,
	CONSTRAINT [PK_ChungChi] PRIMARY KEY CLUSTERED 
	(
		[MaChungChi] ASC
	) ON [PRIMARY]
) 
ON [PRIMARY]
GO

-- Table: LopHoc
CREATE TABLE [dbo].[LopHoc]
(
	[MaLop]			[nvarchar](50) NOT NULL,
	[TenLop]		[nvarchar](50) NOT NULL,
	[MaChungChi]	[nvarchar](50) NOT NULL,
	[NgayKhaiGiang] [datetime] NOT NULL,
	[ThoiGianHoc]	[int] NOT NULL,
	[HocPhi]		[int] NOT NULL,
	CONSTRAINT [PK_LopHoc] PRIMARY KEY CLUSTERED 
	(
		[MaLop] ASC
	)ON [PRIMARY]
) 
ON [PRIMARY]
GO

-- Table: HocVien
CREATE TABLE [dbo].[HocVien]
(
	[MaHocVien]		[nvarchar](50) NOT NULL,
	[HoTen]			[nvarchar](100) NOT NULL,
	[NgaySinh]		[nvarchar](10) NULL,
	[GioiTinh]		[nvarchar](50) NOT NULL,
	[NoiSinh]		[nvarchar](255) NULL,
	CONSTRAINT [PK_HocVien] PRIMARY KEY CLUSTERED 
	(
		[MaHocVien] ASC
	)ON [PRIMARY]
) 
ON [PRIMARY]
GO

-- Table: HocVien_LopHoc
CREATE TABLE [dbo].[HocVien_LopHoc]
(
	[MaHocVien]		[nvarchar](50) NOT NULL,
	[MaLop]			[nvarchar](50) NOT NULL,
	[NgayGhiDanh]	[datetime] NOT NULL,
	CONSTRAINT [PK_HocVien_LopHoc] PRIMARY KEY CLUSTERED 
	(
		[MaHocVien] ASC,
		[MaLop] ASC
	) ON [PRIMARY]
) 
ON [PRIMARY]
GO

-- Table: PhieuThuHocPhi
CREATE TABLE [dbo].[PhieuThuHocPhi]
(
	[SoPhieu]		[int] IDENTITY(1,1) NOT NULL,
	[MaHocVien]		[nvarchar](50) NOT NULL,
	[MaLop]			[nvarchar](50) NOT NULL,
	[NgayNopHocPhi] [datetime] NOT NULL,
	[SoTienNop]		[int] NOT NULL,
	CONSTRAINT [PK_PhieuThuHocPhi] PRIMARY KEY CLUSTERED 
	(
		[SoPhieu] ASC
	) ON [PRIMARY]
) 
ON [PRIMARY]
GO


-------------------------------------------------------------------------
-- CÀI ĐẶT KHÓA NGOÀI (LIÊN KẾT CÁC BẢNG)
-------------------------------------------------------------------------
ALTER TABLE [dbo].[LopHoc]  WITH CHECK ADD  CONSTRAINT [FK_LopHoc_ChungChi] FOREIGN KEY([MaChungChi])
REFERENCES [dbo].[ChungChi] ([MaChungChi])
GO

ALTER TABLE [dbo].[HocVien_LopHoc]  WITH CHECK ADD  CONSTRAINT [FK_HocVien_LopHoc_HocVien] FOREIGN KEY([MaHocVien])
REFERENCES [dbo].[HocVien] ([MaHocVien])
GO

ALTER TABLE [dbo].[HocVien_LopHoc]  WITH CHECK ADD  CONSTRAINT [FK_HocVien_LopHoc_LopHoc] FOREIGN KEY([MaLop])
REFERENCES [dbo].[LopHoc] ([MaLop])
GO

ALTER TABLE [dbo].[PhieuThuHocPhi]  WITH CHECK ADD  CONSTRAINT [FK_PhieuThuHocPhi_HocVien_LopHoc] FOREIGN KEY([MaHocVien], [MaLop])
REFERENCES [dbo].[HocVien_LopHoc] ([MaHocVien], [MaLop])
GO

